import React, { useRef, useEffect, useState, useContext } from 'react'
import './ImageElement.css'

export const ImageElement = (props) => {
  const maxWidht = props.maxWidht
  const imageStyle = {
    maxWidht: { maxWidht },
  }
  return (
    <img
      style={imageStyle}
      className="image-ie"
      src={props.image}
      alt="image"
    />
  )
}
